import React, { useEffect, useState } from "react";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";
//import { Table } from "react-bootstrap";
//import Header from "./header";

const CountryList = () => {
  const [resp, setSocapi] = useState({ data: null, socapis: null });
  // const [load, setLoad] = useState(false);
  //const [error, setError] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      const respGlobal = await axios(`http://localhost:8000/socname/`);
      const respSocapis = await axios(`http://localhost:8000/socapi/`);

      setSocapi({ data: respGlobal.data, repos: respSocapis.data });
    };
    fetchData();
  }, []);
  console.log("render");
  if (resp.data) {
    console.log("d", resp.data, resp.repos);
  }

  return (
    <div>
      <h1>Hello </h1>
      <div>{JSON.stringify(resp.data)}</div>
      <br />
      <div>{JSON.stringify(resp.repos)}</div>
    </div>
  );
};

//ReactDOM.render(<App />, rootElement);

export default CountryList;
